import React from "react";
import ReactDOM from "react-dom";

const SlotM = (props) => {
  // let x = "ðŸ˜„";
  // let y = "ðŸ˜„";
  // let z = "ðŸŽ…";

  let { x, y, z } = props;

  if (x === y && y === z) {
    return (
      <>
        <div className="slot_inner">
          <h1>
            {x} {y} {z}
          </h1>
          <h1>This is Matching</h1>
        </div>
      </>
    );
  } else {
    return (
      <>
        <div className="slot_inner">
          <h1>
            {x} {y} {z}
          </h1>
          <h1>This is not Matching</h1>
        </div>
      </>
    );
  }
};

export default SlotM;
